mapper.select:
select 

from TFS_DOMICILIATION
where BRANCH_CODE = #{BRANCH_CODE}
  and COMP_CODE = #{COMP_CODE}
  and REQUEST_NBR = #{REQUEST_NBR}

mapper.delete:
delete from TFS_DOMICILIATION
where BRANCH_CODE = #{BRANCH_CODE}
  and COMP_CODE = #{COMP_CODE}
  and REQUEST_NBR = #{REQUEST_NBR}
